import React, { useState, useEffect } from 'react';
import './Header.css';
import mynaIcon from '../assets/myna-icon.png';

const Header = () => {
  const [menuOpen, setMenuOpen] = useState(false);

  const toggleMenu = () => {
    setMenuOpen(!menuOpen);
    document.body.classList.toggle('menu-open');
  };

  const closeMenu = () => {
    setMenuOpen(false);
    document.body.classList.remove('menu-open');
  };

  // Close menu when clicking outside
  useEffect(() => {
    const handleClickOutside = (event) => {
      if (menuOpen && !event.target.closest('.navbar')) {
        closeMenu();
      }
    };

    document.addEventListener('click', handleClickOutside);
    return () => {
      document.removeEventListener('click', handleClickOutside);
    };
  }, [menuOpen]);

  return (
    <header className="navbar">
      <div className="nav-container">
        <a href="#" className="brand-logo">
          <span className="brand-icon">
            <img src={mynaIcon} alt="Brand Icon" />
          </span>
          <span className="brand-myna">Myna </span>
          <span> Kitchen</span>
        </a>
        <nav>
          <div 
            className={`menu-toggle ${menuOpen ? 'active' : ''}`} 
            id="menuToggle"
            onClick={toggleMenu}
          >
            <div></div>
            <div></div>
            <div></div>
          </div>

          {/* Mobile CTA button shown outside the menu */}
          <a href="#preorder-meals" className="mobile-cta-button">Try a Meal</a>

          <ul className={`nav-menu-mobile ${menuOpen ? 'active' : ''}`} id="navMenuMobile">
            <li><a href="#home" onClick={closeMenu}>Home</a></li>
            <li><a href="#daily-combos" onClick={closeMenu}>Daily Menu</a></li>
            <li><a href="#subscription" onClick={closeMenu}>Subscriptions</a></li>
            <li><a href="#about" onClick={closeMenu}>About</a></li>
            <li><a href="#contact" onClick={closeMenu}>Contact</a></li>
          </ul>

          <ul className="nav-menu-desktop">
            <li><a href="#home">Home</a></li>
            <li><a href="#daily-combos">Daily Menu</a></li>
            <li><a href="#subscription">Subscriptions</a></li>
            <li><a href="#about">About</a></li>
            <li><a href="#contact">Contact</a></li>
            <li><a href="#preorder-meals" className="cta-button">Try a Meal</a></li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default Header;
